import React from "react";

function SkillCard(props){
    return(
        // main div 
        <div className="w-[25%]">
            <div className="flex justify-evenly flex-row bg-white m-4">
                {/* icon image div  */}
                <div className=" w-[40%]">
                    <img className="h-[70%]" src={props.icon} alt={props.title}></img>
                </div>

                {/* skill name div */}
                <div>
                    {props.title}
                </div>
            </div>
        </div>
    );
}

export default SkillCard;
